import React from 'react'
import { BrowserRouter } from "react-router-dom";
import { Route, Link, Routes} from 'react-router-dom'  
import Footer from './components/layouts/Footer';
import Header from './components/layouts/Header';
import Login from './components/Login/Login';
import AddMember from './components/admin/AddMember';
import EditMember from './components/admin/EditMember';
import Member from './components/admin/Member';
import ViewMember from './components/admin/ViewMember';
const App = () => {
  return (
    <>
    <BrowserRouter>
      <Header/>
      <Routes>
        <Route path='/' component={Login} />
        <Route path='/member' component={Member} />
        <Route path='/add-member' component={AddMember} />
        <Route path='/edit-member' component={EditMember} />
        <Route path='/view-member' component={ViewMember} />
      </Routes>
      <Footer/>
      </BrowserRouter>
    </>
  )
}

export default App
